import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, View } from 'react-native';
import React, { useEffect } from 'react';
import axios from 'axios';

const App = () => {
  useEffect(() => {
    const getCards = async () => {
      try {
        const res = axios.get('https://api.pokemontcg.io/v2/crads?pageSize=10')
        console.log('res, res');
      } catch (err) {
        console.error(err)
      }
    };
    getCards
  }, []);
  return (
    <div>
      <h1>Pokemon Cards rarity</h1>
    </div>
  );
}

export default App;

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
